      "\u001b[1;36m  File \u001b[1;32m\"<ipython-input-48-bcf07f7536a5>\"\u001b[1;36m, line \u001b[1;32m13\u001b[0m\n\u001b[1;33m    def static_f(x)\u001b[0m\n\u001b[1;37m                   ^\u001b[0m\n\u001b[1;31mSyntaxError\u001b[0m\u001b[1;31m:\u001b[0m invalid syntax\n"
