  {
   "cell_type": "markdown",
   "metadata": {},
   "source": [
    "### Naming conventions and special functions\n",
    "In python, there are no truly private variables. Instead, there are some naming conventions that utilize the underscore character. \n",
    "* a single leading underscore is for weak private use (import * will ignore these)\n",
    "* a double leading underscore is for stronger private use (will result in name mangling outside of the class)\n",
    "* a double leading underscore and trailing underscore is for \"magic\" objects or attributes\n",
    "\n",
    "#### Magic functions\n",
    "Magic functions have specific use cases and should only be used as documented. Some of these include\n",
    "* `__init__(self, variable1, variable2, ...)` defines the class initialization function\n",
    "* `__str__(self)` defines the string that is printed when an instance is passed to `print()`\n",
    "* `__del__(self)` defines what happens when an instance is about to be destroyed\n",
    "* you can override many other magic functions (like getters and setters for bracket notation) and much more, see https://docs.python.org/2/reference/datamodel.html"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 30,
   "metadata": {
    "collapsed": false
   },
   "outputs": [
    {
     "name": "stdout",
     "output_type": "stream",
     "text": [
      "ClassName('foo')\n"
     ]
    }
   ],
   "source": [
    "class ClassName:\n",
    "    def __init__(self, s):\n",
    "        self.variable = s\n",
    "    \n",
    "    def __str__(self):\n",
    "        return \"ClassName('\"+self.variable+\"')\"\n",
    "    \n",
    "a = ClassName(\"foo\")\n",
    "print a"
   ]
  },
  {
   "cell_type": "markdown",
   "metadata": {},
   "source": [
    "Putting this all together, we can create a TextReader class for our Shakespeare code. "
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 31,
   "metadata": {
    "collapsed": false
   },
   "outputs": [
    {
     "name": "stdout",
     "output_type": "stream",
     "text": [
      "['Fame.', 'deadly?', 'mustachio', 'Debts', 'laments:']\n",
      "['the', 'I', 'and', 'to', 'of']\n"
     ]
    }
   ],
   "source": [
    "class TextReader:\n",
    "    def __init__(self, fname):\n",
    "        f = open(fname, 'r')\n",
    "        lines = f.readlines()\n",
    "        \n",
    "        self.words = []\n",
    "        for line in lines:\n",
    "            self.words += line.split()\n",
    "    \n",
    "    def word_counts(self):\n",
    "        d = {}\n",
    "        for word in self.words:\n",
    "            if word in d: \n",
    "                d[word] += 1\n",
    "            else:\n",
    "                d[word] = 1\n",
    "        return d\n",
    "\n",
    "t = TextReader('shakespeare.txt')\n",
    "d = t.word_counts()\n",
    "print sorted(d, key=d.get)[:5]\n",
    "print sorted(d, key=d.get, reverse=True)[:5]"
   ]
  },
